DROP TABLE IF EXISTS `app_api`;
CREATE TABLE `app_api` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `app_info_id` bigint(20) NOT NULL,
  `api_code` bigint(11) NOT NULL COMMENT '中枢系统的code',
  `source_api_code` varchar(64) DEFAULT NULL COMMENT '接入方系统的code',
  `path` varchar(255) DEFAULT NULL COMMENT '接入方请求的URL',
  `method` varchar(32) DEFAULT NULL COMMENT 'GET 或者 POST',
  `api_type` varchar(32) DEFAULT NULL COMMENT '数据类型',
  `start_time` datetime DEFAULT NULL COMMENT '生效时间',
  `end_time` datetime DEFAULT NULL COMMENT '失效时间',
  `api_interval` int(11) DEFAULT NULL COMMENT '定时调度间隔时间,单位 秒',
  `areas` text,
  `api_desc` text,
  `state` tinyint(3) DEFAULT NULL,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modify_time` datetime DEFAULT NULL,
  `meta_json` text COMMENT 'meta数据的json字符串',
  `server_code` varchar(255) DEFAULT NULL,
  `source_id` int(10) DEFAULT NULL COMMENT '原来表的id，不要出现在mapper中',
  `create_by` bigint(20) DEFAULT NULL COMMENT '接入方信息创建人',
  `modify_by` bigint(20) DEFAULT NULL COMMENT '接入方信息修改人',
  `api_batch_num` bigint(20) DEFAULT NULL COMMENT '若API为批量导入的，记录导入批次号',
  PRIMARY KEY (`id`),
  KEY `index_api_code` (`api_code`) COMMENT 'api_code非唯一索引',
  KEY `index_api_code_app_info_id` (`app_info_id`,`api_code`),
  KEY `index_app_info_servercode` (`app_info_id`,`server_code`,`state`)
